  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Kodiak NWR outlines
  Refuge accomplishments from May through August of 1961. The report begins by summarizing
  the weather conditions, habitat conditions, water conditions, and food and cover
  during this period. Wildlife- including migratory birds, upland game birds, big
  game animals, furbearers, rodents, mammals, and raptors- is also covered. The Refuge
  development and maintenance section discusses physical developments. A progress
  report on field investigations and applied research is also provided. The public
  relations section of the report describes recreational uses, Refuge visitors, Refuge
  participation, hunting, and violations. Items of interest and N-R forms are attached.\",\n\t\"license_title\":
